# Animasi loading brutal
def brutal_loading(text, duration=2):
    print(f"{CYAN}[+] {text}", end="")
    for _ in range(duration * 10):
        symbols = ["\\", "|", "/", "-", "#", "@", "!", "*"]
        print(f"\r{CYAN}[+] {text} {random.choice(symbols)}", end="")
        time.sleep(0.1)
    print(f"\r{GREEN}[+] {text} SUKSES!{CYAN}")

